      category: new FormControl(),
      priority: new FormControl(),
      // status: new FormControl("WAITING"),
      startDate: new FormControl(),
      endDate: new FormControl(),
      budget: new FormControl(),
      budgetInDays: new FormControl()
    });
  }

  ngOnInit() {
    this.route.paramMap.subscribe(data => {
      this.id = data.params["id"]; // console.log(data.params["id"])

      this.resolvable = true;
      this.getProject(data.params["id"]);
      this.tasks = this.taskService.findByProject(data.params["id"], 0, this.sortField, this.sortDesc);
      this.tasks.subscribe(data => {
        this.totalPages = data.page.totalPages;
        this.resolvable = true;

        for (let task of data._embedded.tasks) {
          if (task.status == 'INPROGRESS' || task.status == 'WAITING') {
            this.resolvable = false;
          }
        }
      });
      this.init();
      this.getAllEmployee();
      this.getAuthor();
      this.author.subscribe(data => {
        data.authorities.authority;
        console.log(data.authorities[0].authority);
      });
    });
  }

  getProject(projectId) {
    this.project = this.projectService.getProject(projectId);
  }

  getAuthor() {
    this.author = this.authorService.getAll();
  }

  getTasks(projectId, page, sortBy, sortDesc) {
    this.tasks = this.taskService.findByProject(projectId, page, sortBy, sortDesc);
    this.tasks.subscribe(data => {
      this.totalPages = data.page.totalPages;
    });
  }

  getTasksByStatus() {}

  init() {
    var members = {};
    var ids = [];
    this.tasks.subscribe(taskData => {
      var doneTask = 0;
      var inprogressTask = 0;
      var waitTask = 0;
      var totalTask = 0;
      var deferredTask = 0; // console.log(taskData)

      for (var i = 0; i < taskData._embedded.tasks.length; i++) {
        let task = taskData._embedded.tasks[i]; // console.log(taskData)

        if (task.status == 'COMPLETED') {
          if (members[task.assignedTo]) {
            members[task.assignedTo]['total'] = members[task.assignedTo]['total'] + 1;
            members[task.assignedTo]['done'] = members[task.assignedTo]['done'] + 1;
          } else {
            members[task.assignedTo] = {
              total: 1,
              done: 1,
              reject: 0
            };
            ids.push(task.assignedTo);
          }
        } else {
          if (task.status == 'DEFERRED') {
            if (members[task.assignedTo]) {
              members[task.assignedTo]['total'] = members[task.assignedTo]['total'] + 1;
              members[task.assignedTo]['reject'] = members[task.assignedTo]['reject'] + 1;
            } else {
              members[task.assignedTo] = {
                total: 1,
                reject: 1,
                done: 0
              };
              ids.push(task.assignedTo);
            }
          } else {
            if (members[task.assignedTo]) {
              members[task.assignedTo]['total'] = members[task.assignedTo]['total'] + 1;
            } else {
              members[task.assignedTo] = {
                total: 1,
                done: 0,
                reject: 0
              };
              ids.push(task.assignedTo);
            }
          }
        }

        totalTask = totalTask + 1;

        if (task.status != 'DEFERRED') {
          if (task.status == 'COMPLETED') {
            doneTask = doneTask + 1;
          } else {
            if (task.status == 'WAITING') {
              waitTask = waitTask + 1;
            } else {
              inprogressTask = inprogressTask + 1;
            }
          }
        } else {
          deferredTask = deferredTask + 1;
        }
      }

      console.log(members);
      var total = {
        // type: 'bar',
        name: 'Total',
        data: []
      };
      var done = {
        // type: 'bar',
        name: 'Done',
        data: []
      };
      var inprogress = {
        // type: 'bar',
        name: 'In Progress',
        data: []
      };
      var reject = {
        // type: 'bar',
        name: 'Reject',
        data: []
      };
      var donePie = ["Done: " + doneTask, doneTask];
      var waitingPie = ["Waiting: " + waitTask, waitTask];
      var totalPie = ["Total", 0];
      var inProgressPie = ["In progress: " + inprogressTask, inprogressTask];
      var deferredPie = ["Reject: " + deferredTask, deferredTask]; // console.log(ids)

      var categories = [];

      for (let id of ids) {
        let member = members[id];
        total.data.push(member.total);
        done.data.push(member.done);
        reject.data.push(member.reject);
        inprogress.data.push(member.total - member.done - member.reject); // donePie[1] = donePie[1] + member.done
