      // inprogress.type = "bar"


      this.barChart = new Chart({
        chart: {
          type: 'bar'
        },
        colors: ['rgb(124, 181, 236)', '#fe6694', 'rgb(144, 237, 125)', '#f77f00'],
        title: {
          text: 'Employee\'s tasks progress'
        },
        credits: {
          enabled: false
        },
        xAxis: {
          categories: categories,
          title: {
